function ExpenseItem() {
    return (
    <div className='expense-item'>
        <div>April 8th 2023</div>
        <div class>
            <h2>Car Insurance</h2>
        <div>Amount</div>
        </div>
    </div>
    );
}

export default ExpenseItem;
